object.script:
white = {255, 255, 255, 128} black = {0, 0, 0, 128} red = {200, 0, 0, 128}
zoom = 1 --anchor example(x, y). Range[0;1] firstRow = {0, 0} lastRow = {0, 1}
--1. Add button(width, height, color, text, textColor, anchor, offsetX, offsetY) zoomInButton = {7, 7, black, "+", white, lastRow, 0, 0} zoomOutButton = {7, 7, black, "-", white, lastRow, 7, 0}
function onTick() w = input.getNumber(1) h = input.getNumber(2) inputX = input.getNumber(3) inputY = input.getNumber(4) bearing = input.getNumber(5)
compassDegrees = bearing * -360 % 360 bearingButton = {17, 7, black, string.format("%.0f", compassDegrees), red, firstRow, 0, 0}
isPressed = input.getBool(1)
--2. Check if it's pressed currentButton = zoomInButton zoomingIn = isPressed and isPointInRectangle(inputX, inputY, w, h, currentButton)
currentButton = zoomOutButton zoomingOut = isPressed and isPointInRectangle(inputX, inputY, w, h, currentButton)
--3. Perform an action if it's pressed if (zoomingOut and zoom < 50) then zoom = zoom + zoom * 0.05 output.setBool(1, true) elseif (zoomingIn and zoom > 0.1) then zoom = zoom - zoom * 0.05 output.setBool(1, true) else output.setBool(1, false) end
output.setNumber(1, zoom) end
function onDraw() w = screen.getWidth() h = screen.getHeight()
--4. Draw the button drawButton(zoomInButton) drawButton(zoomOutButton) drawButton(bearingButton) end
function unpack(pack) return table.unpack(pack) end
function isPointInRectangle(x, y, w, h, button) rectX = button[6][1] * (w - button[1]) + button[7] rectY = button[6][2] * (h - button[2]) + button[8] rectW = button[1] rectH = button[2] return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH end
function drawButton(button) x = button[6][1] * (w - button[1]) + button[7] y = button[6][2] * (h - button[2]) + button[8] width = button[1] height = button[2]
screen.setColor(unpack(button[3])) screen.drawRectF(x, y, width, height)
frameColor = {button[3][1] * 0.8, button[3][2] * 0.8, button[3][3] * 0.8, 255} screen.setColor(unpack(frameColor)) screen.drawRect(x, y, width, height)
screen.setColor(unpack(button[5])) screen.drawTextBox(x, y, width, height, button[4], 1, 1) end
